CREATE DATABASE lobos_kit;
USE lobos_kit;

CREATE TABLE `rol` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `rol` varchar(255)
);

CREATE TABLE `user` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `nombre` varchar(255),
  `correo` varchar(255),
  `cuatrimestre` int,
  `password` varchar(255),
  `carrera` int,
  `id_rol` int
);

CREATE TABLE `asignado` (
  `id_user` int,
  `id_carrera` int
);

CREATE TABLE `carrera` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `nombre` varchar(255)
);

CREATE TABLE `material_asignado` (
  `id_carrera` int,
  `id_material` int
);

CREATE TABLE `material` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `datos` varchar(255),
  `url` text,
  `img_url` text,
  `price` double,
  `reviews` int,
  `rating` double,
  `id_tipo_material` int
);

CREATE TABLE `tipo_material` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `tipo` varchar(255)
);

ALTER TABLE `user` ADD FOREIGN KEY (`id_rol`) REFERENCES `rol` (`id`);

ALTER TABLE `asignado` ADD FOREIGN KEY (`id_user`) REFERENCES `user` (`id`);

ALTER TABLE `asignado` ADD FOREIGN KEY (`id_carrera`) REFERENCES `carrera` (`id`);

ALTER TABLE `material_asignado` ADD FOREIGN KEY (`id_carrera`) REFERENCES `carrera` (`id`);

ALTER TABLE `material_asignado` ADD FOREIGN KEY (`id_material`) REFERENCES `material` (`id`);

ALTER TABLE `material` ADD FOREIGN KEY (`id_tipo_material`) REFERENCES `tipo_material` (`id`);

